import React,{useState} from "react";
import Select from "react-select";
import JanT22 from "../Tables/janT22";
import style from "../"



function MonthData () {
    var MonthList = [
    {
        label: "January 2022",
        "path": <JanT22 />
    },
    // {
    //     label: "February 2022",
    //     "path": <Feb22 />
    // },
    // {
    //     label: "March 2022",
    //     "path": <March22 />
    //     },
    // {
    //     label: "April 2022",
    //     "path": <April22 />
    // },
    // {
    //     label: "May 2022",
    //     "path": <May22 />
    // },{
    //     label: "June 2022",
    //     "path": <June22 />
    // },{
    //     label: "July 2022",
    //     "path": <July22 />
    // },{
    //     label: "August 2022",
    //     "path": <Aug22 />
    // },{
    //     label: "September 2022",
    //     "path": <Sep22 />
    // },{
    //     label: "October 2022",
    //     "path": <Oct22 />
    // },{
    //     label: "November 2022",
    //     "path": <Nov22 />
    // },{
    //     label: "December 2022",
    //     "path": <Dec22 />
    // },{
    //     label: "January 2023",
    //     "path": <Jan23 />
    // },{
    //     label: "February 2023",
    //     "path": <Feb23 />
    // },
    
    ];
    
    const [result, monthvalue] = useState(MonthList.path);
    const monthHandler = e =>
    {
        monthvalue(e.path);
    }
    const [label, monthlabel] = useState(MonthList.label);
    const labelHandler = e => {
        monthlabel(e.label);
    }
    const [isLoggedIn, setIsLoggedIn] = useState(true);
     const handleLogout = () => {
        if (isLoggedIn) {
            setIsLoggedIn(false);
            // setShowProfile(false);
            alert("You have been logged out.");
            window.location.href = '/';
        }
    };
    return (
        <div>
            <div className={style.home_nav_container}>
                        <nav className={style.nav}>
                            <ul>
                                <li><a href="MonthData">Dashboard</a></li>
                                <li><a href="Trans">Transaction</a></li>
                                <li><a onClick={handleLogout}>Logout</a></li>
                            </ul>
                        </nav>
                    </div>
            <Select className={style.select} options={MonthList} onChange={event => monthHandler(event) + labelHandler(event)} placeholder="Enter Month and Year" />
            <h2 className={style.label}>{label}</h2>
            <center>
                <h1>{result}</h1>
            </center>
        </div>
    )
}



export default MonthData;
